import styled from "styled-components";
import { Send } from "@material-ui/icons";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  gap: 40px;
  padding: 20px;
  background-color: #ebfbee;
`;
const Title = styled.div`
  font-size: 80px;
  font-weight: 600;
`;
const Description = styled.div`
  font-size: 30px;
  font-weight: 500;
`;
const Input = styled.input`
  width: 600px;
  border-radius: 2px;
  outline: none;
`;
const InputContainer = styled.div`
  display: flex;
`;
const Button = styled.button`
  border: none;
  background-color: white;
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const Newsletter = () => {
  return (
    <Container>
      <Title>Our Newsletter</Title>
      <Description>
        Get informed about all the latest things from Us!
      </Description>
      <InputContainer>
        <Input />
        <Button>
          <Send />
        </Button>
      </InputContainer>
    </Container>
  );
};

export default Newsletter;
